import { withFactory as _effector$factory } from 'effector';
import { createEffect, createEvent, createStore, sample } from 'effector';
import { createAction } from 'effector-action';
import { createGate } from 'effector-react';
import { persist } from 'effector-storage/local';
import { isUndefined } from 'lodash-es';
import { combineEvents, delay } from 'patronum';
import { navigate } from 'vike/client/router';
import { atom } from '@/shared/factories';
import { is404Error } from '@/shared/lib';
import { getFreeResultQuery, getFullReportQuery, getSurveysInfoQuery } from '../api';
import { $currentContentPage, $currentPage, $isFirstPage, $isLastPage } from './contentPage';
import { $userOrder, $userOrderStatus } from './order';
import { $reportContent } from './reportContent';
import { $allUserReports, $expressUserReports, $freeUserReports, $isUserHasFreeReport, $lastUserFreeReport, $paidUserReports } from './userReports';
export const ReportModel = _effector$factory({
    sid: "8x5mhe6c",
    fn: ()=>atom(()=>{
            const ReportGate = createGate({
                and: [],
                or: {
                    sid: "3osohp11"
                }
            });
            const FreeReportGate = createGate({
                and: [],
                or: {
                    sid: "5lvsh367"
                }
            });
            const freeReportIdReceived = createEvent({
                sid: "8w5v1x9g"
            });
            const fullReportIdReceived = createEvent({
                sid: "abswcep1"
            });
            const $currentFreeReportId = createStore(null, {
                sid: "ctxqxyln"
            });
            const $currentFullReportId = createStore(null, {
                sid: "8mp97y7q"
            });
            sample({
                and: [
                    {
                        clock: freeReportIdReceived,
                        target: $currentFreeReportId
                    }
                ],
                or: {
                    sid: "4a1jilnk"
                }
            });
            sample({
                and: [
                    {
                        clock: fullReportIdReceived,
                        target: $currentFullReportId
                    }
                ],
                or: {
                    sid: "78pz3kf"
                }
            });
            const redirectToMainPageFx = createEffect(async ()=>await navigate('/'), {
                sid: "7fhp1iew"
            });
            sample({
                and: [
                    {
                        clock: getFreeResultQuery.finished.success,
                        filter: ({ result })=>!result,
                        target: redirectToMainPageFx
                    }
                ],
                or: {
                    sid: "3uyenz8y"
                }
            });
            const ReportPageGate = createGate({
                and: [],
                or: {
                    sid: "2f8buem"
                }
            });
            persist({
                store: $currentPage,
                pickup: ReportPageGate.open
            });
            persist({
                store: $currentContentPage,
                pickup: ReportPageGate.open
            });
            $currentContentPage.reset(ReportPageGate.close);
            $currentPage.reset(ReportPageGate.close);
            const currentPageChanged = createEvent({
                sid: "5oyr7qpl"
            });
            createAction({
                clock: currentPageChanged,
                target: {
                    $currentContentPage,
                    $currentPage
                },
                fn: (target, clock)=>{
                    target.$currentPage(clock);
                    target.$currentContentPage(clock - 1);
                }
            });
            const $userMbtiTypes = createStore([], {
                sid: "adqsx5ge"
            });
            sample({
                and: [
                    {
                        clock: getSurveysInfoQuery.finished.success,
                        filter: (data)=>!isUndefined(data.result),
                        fn: ({ result })=>result?.reports.map((report)=>({
                                    [report.user_report]: report.mbti_type
                                })) ?? [],
                        target: $userMbtiTypes
                    }
                ],
                or: {
                    sid: "ctfaei4q"
                }
            });
            const freeReportReceived = _effector$factory({
                sid: "yix2ehi",
                fn: ()=>combineEvents([
                        _effector$factory({
                            sid: "3caku1qe",
                            fn: ()=>delay(FreeReportGate.open, 600)
                        }),
                        freeReportIdReceived
                    ])
            });
            sample({
                and: [
                    {
                        clock: $currentFreeReportId,
                        target: [
                            getFreeResultQuery.reset
                        ]
                    }
                ],
                or: {
                    sid: "4i4vl1tm"
                }
            });
            sample({
                and: [
                    {
                        clock: [
                            freeReportReceived,
                            $currentFreeReportId
                        ],
                        source: $currentFreeReportId,
                        fn: (id)=>({
                                id: id ?? ''
                            }),
                        target: [
                            getFreeResultQuery.refresh
                        ]
                    }
                ],
                or: {
                    sid: "2chjnn6m"
                }
            });
            const fullReportReceived = _effector$factory({
                sid: "7vo4ak1t",
                fn: ()=>combineEvents([
                        _effector$factory({
                            sid: "93svfr50",
                            fn: ()=>delay(ReportPageGate.open, 600)
                        }),
                        fullReportIdReceived
                    ])
            });
            sample({
                and: [
                    {
                        clock: $currentFullReportId,
                        target: [
                            getFullReportQuery.reset
                        ]
                    }
                ],
                or: {
                    sid: "4eeozwqp"
                }
            });
            sample({
                and: [
                    {
                        clock: [
                            fullReportReceived,
                            $currentFullReportId
                        ],
                        source: $currentFullReportId,
                        fn: (id)=>({
                                id: id ?? ''
                            }),
                        target: [
                            getFullReportQuery.refresh
                        ]
                    }
                ],
                or: {
                    sid: "9qo38khe"
                }
            });
            const redirectTo404Fx = createEffect(async ()=>{
                await navigate('/error/404');
            }, {
                sid: "6862zhmf"
            });
            sample({
                and: [
                    {
                        clock: getFreeResultQuery.finished.failure,
                        filter: is404Error,
                        target: redirectTo404Fx
                    }
                ],
                or: {
                    sid: "3o36fmxg"
                }
            });
            return {
                ReportGate,
                $isUserHasFreeReport,
                $lastUserFreeReport,
                $allUserReports,
                $freeUserReports,
                $paidUserReports,
                $expressUserReports,
                $reportContent,
                $userOrder,
                $userOrderStatus,
                $isFirstPage,
                $isLastPage,
                $currentContentPage,
                currentPageChanged,
                $userMbtiTypes,
                ReportPageGate,
                $currentPage,
                FreeReportGate,
                fullReportIdReceived,
                freeReportIdReceived,
                $currentFreeReportId,
                $currentFullReportId
            };
        })
});

